export function ApiView({ champions, apiItem }) {
  const champion = apiItem && champions ? champions[apiItem] : null

  return (
    <div>
      <div>
        {champion ? champion.name : 'No champion found.'}
      </div>
      <div>
        {champion ? champion.title : 'No champion found.'}
      </div>
      <div>
        {champion ? champion.blurb : 'No champion information available.'}
      </div>
      <div>
        {champion ? champion.tags.join(', ') : 'No tags available.'}
      </div>
    </div>
  );
}
